a = 'data:image/jpeg;base64,'


def stringToImage(base64_string):
    base64_string = re.sub('^data:image/.+;base64,', '', base64_string)
    imgdata = base64.b64decode(base64_string)
    return Image.open(io.BytesIO(imgdata))

img = stringToImage(a)

a = img.save('a.jpg')
